import React from 'react';
import './About.css';
import Header from './Header.js';
import Footer from './Footer.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Project from './Project.js';



class About extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goHome = () => {
    this.props.history.push("/");
  }
  render() {
    return (
      <div class="about">
        <Header goToHome={this.goHome} goToAbout={this.goAbout} page={"about"}/>
        <div class="aboutintro">
          <Container fluid={true}>
            <Row noGutters={true}>
              <Col xs={12} sm={12} md={6}>
                <div>
                  <img src="https://png.pngtree.com/png-vector/20190830/ourlarge/pngtree-continuous-one-line-drawing-light-bulb-symbol-idea-and-creativity-isolated-png-image_1716617.jpg"/>
                </div>
              </Col>
              <Col xs={12} sm={12} md={6}>
                <div class="abouttext">
                  <div class="nicetomeet">Nice to meet you.</div>
                  <div>I'm an aspiring software engineer passionate about the intersection of business and technology.</div>
                  <div> Graduating Brown University with a degree in Computer Science and Economics.</div>
                </div>
              </Col>
            </Row>
          </Container> 
        </div>
        <div className = "footercenter">
          <Footer />
        </div>
      </div>
    );
  }
}

export default About;
